    console.log('PortalChatBox');
    const {onClose} = props;
    //const {onClose, chatFrom, chatTo} = props;

    return ReactDOM.createPortal(
        <ChatBox onClose={onClose}/>, // from={chatFrom} to={chatTo}/>,
        document.getElementById("portal-dom")
    );
}

